import React, {useState} from 'react'
import './navbar.css';
import { RiMenu3Line, RiCloseLine} from 'react-icons/ri'

const Navbar = () => {
  const [toggleMenu, setToggleMenu] = useState(false);
  const animals = [
    { id: 1, animal: "Dog" },
    { id: 2, animal: "Bird" },
    { id: 3, animal: "Cat" },
    { id: 4, animal: "Mouse" },
    { id: 5, animal: "Horse" }
  ];

  const getAnimalsContent = animals => {
    let content = []
    for(let i = 0; i < animals.length; i++){
      const item = animals[i]
      content.push(<li key={item.id}>{item.animal}</li>)
    }
    return content;
  }

  return (
    <div className="adri__navbar">
      <div className="adri__navbar-links">
        {/* <div className="adri__navbar-links_logo">
          <img src={logo} alt="logo"  />
        </div> */}
          <div className="adri__navbar-links_container">
            <p><a href="#home"></a>Home</p>
            <p><a href="#projects">Projects</a></p>
            <p><a href="#about"></a>About</p>       
          </div>
      </div>
      <div className="adri__navbar-menu">
        {toggleMenu
          ? <RiCloseLine color="#fff" size={27} onClick={() => setToggleMenu(false)} />
          : <RiMenu3Line color="#fff" size={27} onClick={() => setToggleMenu(true)} />}
        {toggleMenu && (
          <div className='adri__navbar-menu_container scale-up-center'>
            <div className="adri__navbar-menu_container-links">
            <p><a href="#home"></a>Home</p>
            <p><a href="#projects">Projects</a></p>
            <p><a href="#about"></a>About</p>
          </div>
          </div> 
        )}

      </div>
    </div>

    );
};

export default Navbar
